		            //סיום משחק
		            function gameOver() {
		                gameEnd = true;
		                //לקיחת זמן סיום
		                endTime = window.performance.now();
		                //חישוב הזמן והמרה לדקות          
		                seconds = (endTime - startTime - overAllPauseTime);
		                while (seconds >= 60000) {
		                    seconds = seconds - 60000;
		                    minets++;
		                }
		                if (seconds < 60000) {
		                    seconds = seconds / 1000;
		                }
		
		               
		                //קיצור הזמן לשני מספרים אחרי הנקודה
		                seconds = seconds.toFixed(0);
		
		                if (seconds < 10) {
		                    seconds = "0" + seconds;                    
		                }
		                if (minets < 0) {                    
		                        minets = "0" + minets;
		                }
		
		              
		                //הכנסת תוכן למערך של אינדקס שאלות שטעו בהן
		                //ספירת שגיאות
		                for (i = 1; i < (AllTheContent[GameNum].length); i++) {
		                    if (AllTheContent[GameNum][i][3] == "mistake") {
		                        worngAnsIndex.push(i);
		                        worngAnsCount++;
		                    }
		                }
		
		                //חישוב ציון
		                grade = 100 * (1 - (worngAnsCount / (AllTheContent[GameNum].length - 1)))
		                grade = grade.toFixed(0);
		
		                //קריאה לניקוי מסך
		                clearGameBoard();
		                //קריאה ליצירת חלון סוף משחק
		                CreateSum();
		
		            }
		
		
