		            //פונקציות כלליות לכל מיני חלקים במשחק
		
		            //--- בדיקת חפיפה בין שני אובייקטים
		            function intersect(obj1, obj2) {
		
		                //תפוח
		                var obj1W = obj1.nominalBounds;
		                //בלנדר
		                var obj2W = obj2.HitZone.nominalBounds;           
					
					//מתקן את הצד הימני
		                var BlanderX = obj2.x + obj2.HitZone.x ;
		                var BlanderY = obj2.y + obj2.HitZone.y;
		                var BlanderRight = BlanderX + obj2W.width;
		                var BlanderTop = BlanderY;
		                var BlanderHalfW = BlanderRight + obj2W.width / 2;
		
		                var AppelRight = obj1.x;
		                var AppelTop = obj1.y;
		                var AppelHalfW = AppelRight + obj1W.width / 2;
		                var AppelHalfH = AppelTop + obj1W.height / 2;
		
		                //יותר מחצי תפוח נמצא מחוץ לבלנדר מצד ימין
		                if (AppelHalfW <= BlanderRight - (obj2W.width / 2) -150) {
		                    return false;
		                    //יותר מחצי תפוח מעל
		                } else if (AppelHalfH <= BlanderTop - (obj2W.height / 2)) {
		                    return false;
		                    //יותר מחצי תפוח יוצר מצד שמאל
		                } else if (AppelRight - (obj1W.width / 2) > BlanderHalfW-270) {
		                    return false;
		                }               
		                return true;
		            }
		
		
